PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE bairro ( 
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(255) DEFAULT NULL UNIQUE
);
CREATE TABLE cidade (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(45) DEFAULT NULL UNIQUE
);
CREATE TABLE endereco (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(255) DEFAULT NULL UNIQUE
);
CREATE TABLE estado (
	uf char(2) NOT NULL PRIMARY KEY,
	nome varchar(20) DEFAULT NULL UNIQUE
);
CREATE TABLE cep(
	cep integer NOT NULL PRIMARY KEY,
	endereco_id integer NOT NULL,
	estado_uf char(2) NOT NULL,
	cidade_id integer NOT NULL,
	bairro_id integer NOT NULL,
	FOREIGN KEY(bairro_id) REFERENCES bairro(id),
	FOREIGN KEY(cidade_id) REFERENCES cidade(id),
	FOREIGN KEY(estado_uf) REFERENCES estado(uf),
	FOREIGN KEY(endereco_id) REFERENCES endereco(id)
);
CREATE TABLE tipo_telefone (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(45) NOT NULL UNIQUE
);
CREATE TABLE telefone (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	tipo_telefone_id integer DEFAULT NULL,
	numero integer NOT NULL,
	FOREIGN KEY(tipo_telefone_id) REFERENCES tipo_telefone(id)
);
CREATE TABLE vendedor (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(45) DEFAULT NULL UNIQUE,
	telefone varchar(45) DEFAULT NULL,
	ativo BOOL
);
CREATE TABLE vendedor_has_telefone (
	vendedor_id integer NOT NULL,
	telefone_id integer NOT NULL,
	PRIMARY KEY (vendedor_id,telefone_id),
	FOREIGN KEY(telefone_id) REFERENCES telefone(id),
	FOREIGN KEY(vendedor_id) REFERENCES vendedor(id)
);
CREATE TABLE empresa (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	numero integer NOT NULL,
	cep_cep integer NOT NULL,
	nome varchar(45) DEFAULT NULL UNIQUE,
	FOREIGN KEY(cep_cep) REFERENCES cep(cep)
);
CREATE TABLE empresa_has_telefone (
	empresa_id integer NOT NULL,
	telefone_id integer NOT NULL,
	PRIMARY KEY (empresa_id,telefone_id),
	FOREIGN KEY(telefone_id) REFERENCES telefone(id),
   FOREIGN KEY(empresa_id) REFERENCES empresa(id)
);
CREATE TABLE nacionalidade (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(45) DEFAULT NULL UNIQUE
);
CREATE TABLE cliente (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	cep_cep integer NOT NULL,
	estado_uf char(2) NOT NULL,
	nacionalidade_id integer NOT NULL,
	empresa_id integer NOT NULL,
	cpf bigint(11) NOT NULL UNIQUE,
	data_cadastro datetime DEFAULT NULL,
	nome varchar(100) NOT NULL,
	data_nascimento datetime DEFAULT NULL,
	estado_civil varchar(20) DEFAULT NULL,
	rg varchar(20) DEFAULT NULL,
	rg_data_emissao date DEFAULT NULL,
	nome_pai varchar(255) DEFAULT NULL,
	nome_mae varchar(255) DEFAULT NULL,
	renda double DEFAULT NULL,
	cargo varchar(45) DEFAULT NULL,
	obs varchar(255) DEFAULT NULL,
	rg_orgao_emissor varchar(45) DEFAULT NULL,
	endereco_numero integer DEFAULT NULL,
	local_nascimento integer DEFAULT NULL,
	FOREIGN KEY(empresa_id) REFERENCES empresa(id),
	FOREIGN KEY(cep_cep) REFERENCES cep(cep),
	FOREIGN KEY(estado_uf) REFERENCES estado(uf),
	FOREIGN KEY(local_nascimento) REFERENCES cidade(id),
	FOREIGN KEY(nacionalidade_id) REFERENCES nacionalidade(id)
);
CREATE TABLE cliente_has_telefone (
	cliente_id integer NOT NULL,
	telefone_id integer NOT NULL,
	PRIMARY KEY (cliente_id,telefone_id),
	FOREIGN KEY(telefone_id) REFERENCES telefone(id),
	FOREIGN KEY(cliente_id) REFERENCES cliente(id)
);
CREATE TABLE forma_pagamento (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	nome varchar(45) DEFAULT NULL UNIQUE,
	parcelas integer DEFAULT NULL,
	entrada BOOL,
	desconto float DEFAULT NULL,
	juro float DEFAULT NULL
);
CREATE TABLE compra (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT, 
	vendedor_id integer NOT NULL,
	forma_pagamento_id integer NOT NULL,
	cliente_id integer NOT NULL,
	valor double NOT NULL,
	data_compra date NOT NULL,
	itens integer DEFAULT NULL,
	paga BOOL,
	FOREIGN KEY(cliente_id) REFERENCES cliente(id),
	FOREIGN KEY(vendedor_id) REFERENCES vendedor(id),
	FOREIGN KEY(forma_pagamento_id) REFERENCES forma_pagamento(id)
);
CREATE TABLE conjuge (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	empresa_id integer NOT NULL,
	cliente_id integer NOT NULL,
	nome varchar(255) DEFAULT NULL,
	data_nascimento date DEFAULT NULL,
	renda double DEFAULT NULL,
	cargo varchar(45) DEFAULT NULL,
	FOREIGN KEY(cliente_id) REFERENCES cliente(id),
	FOREIGN KEY(empresa_id) REFERENCES empresa(id)
);
CREATE TABLE parcela (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	compra_id integer NOT NULL,
	valor double DEFAULT NULL,
	data_vencimento date DEFAULT NULL,
	paga BOOL,
	FOREIGN KEY(compra_id) REFERENCES compra(id)
);
CREATE TABLE pagamento (
	id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	parcela_id integer NOT NULL,
	valor double DEFAULT NULL,
	data_pagamento datetime DEFAULT NULL,
	FOREIGN KEY(parcela_id) REFERENCES parcela(id)
);
DELETE FROM sqlite_sequence;
COMMIT;
